import React, { Component } from 'react'
import { Navbar, Nav, Button, Container, Row, Col, Form } from 'react-bootstrap'
import { Link } from 'react-router-dom'
import Logo from '../Logo.png'

const divStyle = {
    opacity: 0.6
  };
  const textStyle = {
    opacity: 0.6
  };
export default class Nave extends Component {
    render() {
        return (
            <div>

                <Navbar bg="dark" variant="dark">

                </Navbar>

                <Navbar bg="dark" variant="dark" >
                <Navbar.Brand href="#home">
                        <img
                            alt=""
                            src={Logo}
                            width="170px"
                            height="auto"
                            style={divStyle}
                            className="d-inline-block align-top"
                        />{' '}
                    </Navbar.Brand>
                    <Nav className="mr-auto" variant="tabs"  >
                        <Nav.Link as={Link} to="/Home">Home</Nav.Link>
                        <Nav.Link as={Link} to="/*">Profile</Nav.Link>
                        <Nav.Link as={Link} to="/*">Timeline</Nav.Link>

                    </Nav>

                    <Nav>
                        <div>
                            <Button as={Link} to="/Login" variant="outline-light" >  Sign In  </Button>
                            <Button as={Link} to="/Register" variant="outline-light" className="ml-3"> Register</Button>
                        </div>
                    </Nav>
                </Navbar>

            </div>
        )
    }
}
